import { useParams } from 'react-router-dom';
import ProductGrid from '../../Components/ProductGrid/ProductGrid';

const Catalog = () => {
  const { categoryName } = useParams();

  return (
    <div className="catalog-page">
      <ProductGrid category={categoryName} />
    </div>
  );
};
